import React, { Component } from 'react'

class Exercise extends Component {
    state = { 
        title:['t1', 't2','t3'],
    } 
    render() { 
        return (
            <React.Fragment>
                <ul>
                    {this.state.tags.map(tag => <li key ={tag}>{ tag }</li>)}
                </ul>
            </React.Fragment>
        );
    }
}
 
export default Exercise;
